import React, { useState } from "react";
import { Link } from "react-router-dom";

const Dashboard = (props) => {
  const { friend, setFriend } = useState();
  return;
  <div>
    <h3>Welcome User</h3>
    <h4>Lets Chat </h4>
    <input type="text" placeholder="type your friend's username"></input>
    <Link
      onClick={(event) => (!friend ? event.preventDefault() : null)}
      to={`/chat?name=${friend}`}
    >
      <button>Chat</button>
    </Link>
  </div>;
};

export default Dashboard;
